    return (
        <div className="card">
            <img
                src={thumbnail}
                alt=""
            />
            <div className="card__textall">
                <p>{title}</p>
                <p1><span className="card__textall__channel">{channel}</span> {views}</p1>
                <div className="card__textall__details">
                    <p>{desp}</p>

                </div>
            </div>

        </div>
    )
}

export default Card
